        cin >> a[i];
    }
    for (int i = 0; i < k; i++) {
        int x, y;
        cin >> x >> y;
        a[x - 1] += 1;
        a[y - 1] -= 1;
    }
    for (int i = 0; i < n; i++) {
        if (a[i] < 0) {
            a[i] = -a[i];
        }
    }
    int ans = 1;
    for (int i = 0; i < n; i++) {
        ans = ans * a[i] / __gcd(ans, a[i]);
    }
    cout << ans << endl;
    return 0;
}
